s. To add elements create an ontology, choose it from the overview on the left-hand side and open <i>Step 2b: Edit ontology<\/i>.<br><br><\/p><p><b>Delete ontology:<\/b> If you want to delete an existing ontology, just choose it from the list. However, if you delete an ontology which is used by one or multiple templates, these templates and all maps that are based on these templates will be deleted as well. Use this option with care!<\/p>',qof='<p><b>Description:<\/b> In this step, you will be able to edit the elements of the chosen ontology. There is an overview of nodes and relations of the ontology on the left-hand side ("Elements of this ontology"), whereas a preview of the currently selected element is shown on the right-hand side. The actions that can be done are shown in the bottom area in this step. Please consult the manual for further instructions.<br><br><\/p>',Fmf='<p><b>Description:<\/b> Once the ontology and template is defined, you have here the possibility to create concrete instances of an argument map. On the left-hand side, there is an overview of all existing maps (pre-defined as well as user-created ones) sorted by template. On the right-hand side, you can choose if you want to add or delete a map.<br><br><\/p><p><b>Add map:<\/b> To add a new map, you have to choose a template on which the map is based on. Further, each map requires a unique name, which will appear in the map overview after login. Optionally, you can restrict a map to a single user (this of course does only makes sense, if you do not plan to argue collaboratively in this map). To restrict a map to a specific user, choose one from the list. Otherwise leave the field emptry to make it accessible for all users of the system. If you do not want to create pre-defined maps, you can skip this step. Users with role "Standard" (or higher) have the possibility to create new maps based on templates in the map overview anyway.<br><br><\/p><p><b>Delete map:<\/b> If you want to delete a map, just choose it from the list. However, you will no longer be able to replay or restore the contents of the map.<\/p>',ynf='<p><b>Description:<\/b> Once, the ontology is defined, there is a need for a template. Whereas the ontology defines the elements available for modeling the argument, the template is used to configure the interface of the system. On the left-hand side of this step, there is an overview of existing templates sorted by ontologies. Similar to the other steps, there is - on the right-hand side - a set of possible actions: (1) add template, and (2) delete template.<br><br><\/p><p><b>Add template:<\/b> As a first step, you have to decide if you want to support individual or collaborative argumentation. If you want to support argumentation in groups, you have to enable the checkbox "Collaboration". Once, you enable collaboration, you have a set of options that needs to be defined:<br><br><\/p><ul><li><i>Maximum number of users<\/i><br><\/li><li><i>List of active users:<\/i> Shows a list of users that are actively working on a map instance based on the template<br><\/li><li><i>Use chat:<\/i> Provide a simple text chat in the interface<br><\/li><li><i>Cursor tracking(not recommended for standard use):<\/i> The users\' cursors will be visible to all other users that participate at an argument map (next step) which is based on this template. <i>Important:<\/i> This option should be used with care! It will cause a lot of traffic which may lead to problems with slow connections or multiple / larger groups of users.<br><br><\/li><\/ul><p>The next step to decide is if there should be a given internally text that can be used to create relations between the text and the argument elements. To enable linking between the text and the argument element, it is important to know that it is only possible to relate an element to a complete line (or multiple lines) but not to single words or parts of a transcript line.<\/p><p>In addition to these specific options, there is a set of general options. Here, you have to choose on which ontology the template is based as well as a unique and a (optional) description which appears during login in the details of the map.<br><br><\/p><p><b>Delete template:<\/b> If you want to delete an existing template, just choose it from the list. If this template is used by one or more map, these maps will be deleted as well and not restoreable!<\/p>',Vzf='<pre>',pTe='<span  unselectable=on class="x-tree3-node-text">',USe='<span class="x-tree3-node-check"><\/span>',WSe='<span class="x-tree3-node-icon"><\/span>',FMe="<span class='x-tab-strip-inner' role='presentation'><span class='x-tab-strip-text {textStyle} {iconStyle}'>{text}<\/span><\/span>",jqf='<span style="color: #000000;">Blue<\/span>',wqf='<span style="color: #000000;">Dashed<\/span>',uqf='<span style="color: #000000;">Double<\/span>',Sof='<span style="color: #000000;">Editable<\/span>',ypf='<span style="color: #000000;">First<\/span>',iqf='<span style="color: #000000;">Green<\/span>',qpf='<span style="color: #000000;">Label',Tof='<span style="color: #000000;">Non-Editable<\/span>',spf='<span style="color: #000000;">Option1<\/span>',upf='<span style="color: #000000;">Option2<\/span>',wpf='<span style="color: #000000;">Option3<\/span>',gqf='<span style="color: #000000;">Orange<\/span>',pqf='<span style="color: #000000;">Other... <\/span>(<span style="color: ',kqf='<span style="color: #000000;">Other...<\/span>',fqf='<span style="color: #000000;">Red<\/span>',vqf='<span style="color: #000000;">Round Edges<\/span>',zpf='<span style="color: #000000;">Second<\/span>',sqf='<span style="color: #000000;">Standard<\/span>',Apf='<span style="color: #000000;">Third<\/span>',hqf='<span style="color: #000000;">Yellow<\/span>',tqf='<span style="color: #000000;">Zig Zag<\/span>',ogf='<span style="color:#333;">',XSe='<span unselectable="on" class="x-tree3-node-text">',_Be='<table cellpadding=0 cellspacing=0>',NRe='<table cellspacing="0" class="x-toolbar-ct" role=
